"240667":{"id":"240667","name":"Um Dia","slug":"um-dia","original_title":"One Day","overview":"Após passarem a noite de formatura juntos, Emma e Dexter seguem caminhos diferentes, mas suas vidas continuam interligadas.","first_air_date":"2024-02-08","episode_run_time":0,"vote_average":7.7,"number_of_seasons":1,"number_of_episodes":14,"created_by":["Nicole Taylor"],"production_companies":["Drama Republic","Universal International Studios"],"genres":["Drama"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/4zP0CfrUBQFWMlWoB4p8aS4D4IA.jpg","poster_path":"https://image.tmdb.org/t/p/original/smBWt8rHCCavV88C5gQVjh0NUFa.jpg","cast":["Ambika Mod","Leo Woodall"],"trailer":"1q8zGQbGLsQ","seasons":{"1":{"name":"Minissérie","poster_path":"https://image.tmdb.org/t/p/original/dK8eCxRw24Oig5UvEwWRaSyLmW5.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/dK8eCxRw24Oig5UvEwWRaSyLmW5.jpg","air_date":"2024-02-08","episode_count":14,"overview":"Após passarem a noite de formatura juntos, Emma e Dexter seguem caminhos diferentes, mas suas vidas continuam interligadas.","vote_average":8.1,"episodes":{"1":{"name":"Episódio 1","overview":"O ano é 1988. Emma e Dexter se encontram pela primeira vez bem no dia da formatura. A noite é de quase romance, mas a manhã é de oportunidades perdidas.","air_date":"2024-02-08","runtime":39,"still_path":"https://image.tmdb.org/t/p/original/1EvCd9C2hjRFBNOuRJJ3QlWXdiu.jpg","vote_average":8},"2":{"name":"Episódio 2","overview":"O ano é 1989. Em e Dex estão em cantos muito diferentes (um vilarejo em Roma e um furgão nas Midlands) e refletem sobre o que vem pela frente.","air_date":"2024-02-08","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/cW1jzVfCOuwvXjUbnfnktMpFh6x.jpg","vote_average":8},"3":{"name":"Episódio 3","overview":"O ano é 1990. A vida em Londres não é o que Em esperava e ela resolve trabalhar em um restaurante meio estranho. Lá, recebe a visita de Dex.","air_date":"2024-02-08","runtime":22,"still_path":"https://image.tmdb.org/t/p/original/jJDgSeDJ2aDQgi7HI19vTjwwfTU.jpg","vote_average":8.2},"4":{"name":"Episódio 4","overview":"O ano é 1991. Emma e Dexter estão de férias na Grécia, e ela já esquematizou tudo para manter as coisas no campo platônico. Só que ele está querendo um pouco mais.","air_date":"2024-02-08","runtime":28,"still_path":"https://image.tmdb.org/t/p/original/cwQdM99mpBAaL3NdBec6MVaxCBv.jpg","vote_average":8.5},"5":{"name":"Episódio 5","overview":"O ano é 1992. Depois de uma noitada e uma ressaca braba, Dexter vai visitar a família e acaba levando um puxão de orelha da mãe.","air_date":"2024-02-08","runtime":33,"still_path":"https://image.tmdb.org/t/p/original/40yNDXbFE7p7BOYS3Wj1xVUEeug.jpg","vote_average":8.2},"6":{"name":"Episódio 6","overview":"O ano é 1993. É a vez de Dexter brilhar, e enquanto isso Em encara os palcos. Ela passa confiança ao elenco, mas ele sofre um baque.","air_date":"2024-02-08","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/pImJ56ZlUIfUicoxJef4OFnJFPN.jpg","vote_average":7.6},"7":{"name":"Episódio 7","overview":"O ano é 1994. Um jantar chique, mas cheio de erros. Dexter está louco para exibir seu novo estilo de vida luxuoso, mas Emma não fica nada impressionada.","air_date":"2024-02-08","runtime":31,"still_path":"https://image.tmdb.org/t/p/original/l4VFWg5gLWqOx46Qt6XSBT8WWrl.jpg","vote_average":8},"8":{"name":"Episódio 8","overview":"O ano é 1995. No último dia do período escolar, Emma se vê em uma posição comprometedora no trabalho. Quando ela chega em casa, as coisas ficam ainda piores.","air_date":"2024-02-08","runtime":29,"still_path":"https://image.tmdb.org/t/p/original/fyJ4XN3rcLnUufmBamxFKGY087H.jpg","vote_average":7.7},"9":{"name":"Episódio 9","overview":"O ano é 1996. Dexter quer impressionar os pais da nova namorada, mas a visita não sai conforme o esperado. No jantar, ele recebe uma ligação do seu agente.","air_date":"2024-02-08","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/tPljN0rHJTU2e8hj8UDavV1jsnz.jpg","vote_average":7.7},"10":{"name":"Episódio 10","overview":"O ano é 1997. Em e Dex se esbarram em uma festa de casamento. Depois de um reencontro meio estranho, eles passam horas conversando e perdem a noção do tempo.","air_date":"2024-02-08","runtime":32,"still_path":"https://image.tmdb.org/t/p/original/WRNXpG5ywfc4toGNySIxYXHUvm.jpg","vote_average":8.3},"11":{"name":"Episódio 11","overview":"O ano é 1998. Dexter ainda está se adaptando à vida doméstica. Certa noite, após encontrar uma fita antiga de Emma, ele decide ligar para a amiga.","air_date":"2024-02-08","runtime":19,"still_path":"https://image.tmdb.org/t/p/original/pRVF7olO9PFw1JjtzMGVbRvP48P.jpg","vote_average":7.7},"12":{"name":"Episódio 12","overview":"O ano é 1999. Perturbado, Dexter visita Emma, que está em Paris. Enquanto caminham pelas ruas, as lembranças do encontro de meses atrás pairam no ar.","air_date":"2024-02-08","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/7uUAvTg8zd8Q57WeO5XE3K3W9HQ.jpg","vote_average":8.7},"13":{"name":"Episódio 13","overview":"2000. 2001. 2002. O vínculo entre Em e Dex vai ficando mais próximo com o passar dos anos. Ela está arrasando como escritora, e ele abre seu próprio negócio.","air_date":"2024-02-08","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/wHlzsW4dpuhdmGKoPKHtoQZRtYE.jpg","vote_average":8.3},"14":{"name":"Episódio 14","overview":"2003. 2004. 2007. Incapaz de olhar para o futuro, Dexter reflete sobre seu passado com Emma e recebe a visita de alguns rostos familiares.","air_date":"2024-02-08","runtime":36,"still_path":"https://image.tmdb.org/t/p/original/rENGz6QcH56EVah01YXpgizyBGC.jpg","vote_average":8.7}}}}},
