"100429":{"id":"100429","name":"100 Humanos","slug":"100-humanos","original_title":"100 Humans: Life's Questions. Answered.","overview":"Cem pessoas com histórias diferentes participam de experimentos divertidos sobre idade, sexo, felicidade e outros aspectos da vida humana.","first_air_date":"2020-03-13","episode_run_time":38,"vote_average":6,"number_of_seasons":1,"number_of_episodes":8,"created_by":[],"production_companies":[],"genres":["Documentário"],"certification":"12","backdrop_path":"https://image.tmdb.org/t/p/original/yZchL8hEZgpRB0uotYrErbBtXbr.jpg","poster_path":"https://image.tmdb.org/t/p/original/zKrJv2vIAaq3kRAPgvVcFNY3UU5.jpg","cast":["Haley Bockrath","Tyanta Snow","Komalpreet Batth","Braxton Hale","Alfredo Tavares"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/originalnull","backdrop_path":"https://image.tmdb.org/t/p/originalnull","air_date":"2020-03-13","episode_count":8,"overview":"Cem pessoas com as mais diferentes histórias participam de uma experiência envolvendo idade, sexo, felicidade e outros aspectos da vida humana.","vote_average":6.1,"episodes":{"1":{"name":"O que nos torna atraentes?","overview":"A audiência é convidada a ajudar a descobrir o que estimula o desejo sexual nas pessoas. Danças eróticas? Uniformes? Piadas? Os números dirão.","air_date":"2020-03-13","runtime":38,"still_path":"https://image.tmdb.org/t/p/original/bTpqyNZYZ86zc2X7m7e3Dkb1vTs.jpg","vote_average":5.3},"2":{"name":"Qual é a melhor idade?","overview":"Os apresentadores fazem descobertas surpreendentes quando grupos de diferentes gerações competem em provas envolvendo habilidades físicas, intelectuais e cognitivas.","air_date":"2020-03-13","runtime":38,"still_path":"https://image.tmdb.org/t/p/original/lmEanQ0ovHIMoMJGu30Clzoe4cB.jpg","vote_average":6.5},"3":{"name":"Guerra dos sexos","overview":"Os participantes colocam a guerra dos sexos sob a lente de aumento, comprovando alguns mitos e derrubando outros tantos.","air_date":"2020-03-13","runtime":37,"still_path":"https://image.tmdb.org/t/p/original/3Vywal6IAKoODuCu8OJLQvzeSZS.jpg","vote_average":6.3},"4":{"name":"Você é preconceituoso?","overview":"O viés cognitivo mostra a cara quando participantes julgam uns aos outros pelo sotaque, têm de atirar em pessoas aleatórias e subestimam os próprios companheiros.","air_date":"2020-03-13","runtime":39,"still_path":"https://image.tmdb.org/t/p/original/g1zt25BVLjCVLLlmXr0VyIYpjTk.jpg","vote_average":8},"5":{"name":"Dor x Prazer","overview":"Os participantes comparam recompensas e punições, enquanto os apresentadores analisam como experiências positivas e negativas moldam a nossa realidade.","air_date":"2020-03-13","runtime":41,"still_path":"https://image.tmdb.org/t/p/original/aGpigQA6efz21pDKJcNCtKX10N7.jpg","vote_average":6},"6":{"name":"Como ser feliz","overview":"Os apresentadores analisam a alegria por meio de experimentos que envolvem trabalhos manuais, festas, tinta secando e catástrofes.","air_date":"2020-03-13","runtime":32,"still_path":"https://image.tmdb.org/t/p/original/bwoVCTBSR9RYrI4c18D2sJL0PXL.jpg","vote_average":5},"7":{"name":"Você confia nos seus sentidos?","overview":"Seguir a intuição? Nem sempre. Os apresentadores descobrem como o olfato, a visão e o paladar podem ser influenciados por elementos externos, incluindo música e mímicos.","air_date":"2020-03-13","runtime":36,"still_path":"https://image.tmdb.org/t/p/original/yo1cSGSP9r5C2V54p7t1JwgUMhU.jpg","vote_average":6},"8":{"name":"Pergunte a uma pessoa","overview":"Hora das perguntas escolhidas pelos participantes. Quem são os heróis mais populares? Nomes fazem diferença? E, acima de tudo, como devemos usar o papel higiênico?","air_date":"2020-03-13","runtime":33,"still_path":"https://image.tmdb.org/t/p/original/bokDUYemPJv5Q001rNA6P3Bqrtp.jpg","vote_average":6}}}}},
