"210793":{"id":"210793","name":"Damn Envy","slug":"damn-envy","original_title":"Cochina envidia","overview":"Quatro grandes amigas transformam um jantar de comemoração em um completo pesadelo; as coisas ficam tóxicas quando amizade e inveja se sentam juntas à mesa.","first_air_date":"2022-10-07","episode_run_time":30,"vote_average":5.5,"number_of_seasons":1,"number_of_episodes":6,"created_by":["Carolina Cuervo"],"production_companies":["Telecolombia"],"genres":["Comédia","Drama"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/c25MJlF7KgvC35W8FN8xVrsB9bR.jpg","poster_path":"https://image.tmdb.org/t/p/original/yP8ORJ1uvBbYuGoPlLTTHWdMp6X.jpg","cast":["Carolina Cuervo","Ana María Orozco","Cecilia Navia","Santiago Alarcón","Jacques Toukhmanian"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/yP8ORJ1uvBbYuGoPlLTTHWdMp6X.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/yP8ORJ1uvBbYuGoPlLTTHWdMp6X.jpg","air_date":"2022-10-07","episode_count":6,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Ingredientes e Receita","overview":"Ana descobre que sua melhor amiga María ganhou um prêmio literário na Espanha e se tornou uma escritora famosa e premiada. Tina se despede do filho, e Flora conta que a irmã Ana organizou um jantar para homenagear María. María está de volta ao país, mas não consegue encontrar o marido Juan.","air_date":"2022-10-07","runtime":29,"still_path":"https://image.tmdb.org/t/p/original/sTz38FMjsBCGvbJcaKpPRHUB0WZ.jpg","vote_average":0},"2":{"name":"Aperitivos","overview":"María bebe aguardente e soluça enquanto as amigas tentam descobrir o que aconteceu. Leo, Juan e Enrique vão acampar, mas nada é como o esperado. María quer invocar o \"código vermelho\", mas Ana fica furiosa.","air_date":"2022-10-07","runtime":28,"still_path":"https://image.tmdb.org/t/p/original/63R2v2PVrKUC1abasLXy2TG34tE.jpg","vote_average":0},"3":{"name":"Entradas","overview":"Ana pergunta se elas podem recomeçar do zero, e todas se esforçam. Estão entusiasmadas com o jantar, mas a paz dura pouco, e logo o clima fica tenso entre Ana, María e Flora. Leo e Enrique continuam tentando lidar com o sofrimento de Juan. Tina revela um segredo de María, e esse segredo traz à tona um segredo de Ana.","air_date":"2022-10-07","runtime":32,"still_path":"https://image.tmdb.org/t/p/original/8ZwAePM5XJR35KQDAC5fudjt7nK.jpg","vote_average":0},"4":{"name":"Prato Principal","overview":"A situação é tão absurda que Flora e Tina caçoam das amigas, o que gera outra discussão. Flora vomita, o que levanta suspeitas. Leo, Juan e Enrique decidem beber e fumar maconha. Uma confissão de Flora chateia Ana.","air_date":"2022-10-07","runtime":33,"still_path":"https://image.tmdb.org/t/p/original/hWpeeElwecFpuFtjcY1Pyy9REhy.jpg","vote_average":0},"5":{"name":"Segundo Prato","overview":"Novas revelações provocam conversas profundas entre as amigas. Tina coloca música para tocar e manda as quatro fazerem uma trégua, e elas dançam uma antiga coreografia. Juan parece estar melhor e se diverte com Leo e Enrique. Depois de mais uns drinques, Flora causa um tumulto, e ele resulta numa acusação que tira Tina de sua zona de conforto.","air_date":"2022-10-07","runtime":32,"still_path":"https://image.tmdb.org/t/p/original/kAUYDkP2Q953zFbuzAcVMpynUOE.jpg","vote_average":0},"6":{"name":"Sobremesa","overview":"Um empecilho impede que Leo, Juan e Enrique vão embora. As coisas na casa de Ana não estão nada boas e, na hora da sobremesa, uma reviravolta gera uma batalha. As amigas botam para fora toda a inveja e a dor que sentem até não terem mais o que falar. Todas sentem tanta vergonha que chega a ser difícil encarar umas às outras.","air_date":"2022-10-07","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/qX6eYfe5XVMcY9fyHwrpQmW1fg6.jpg","vote_average":0}}}}},
